import "./App.css";
import Stocks from "./components/Stocks";
import Obligations from "./components/Obligations";
import Risk from "./components/Risk";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import SocketNavigation from "./components/SocketNavigation";
import Recording from "./components/Recording";
import S2t from "./components/S2t";

function App() {
  //const names = {
  //  "Socket Navigation": "./SocketNav",
  //  "Speech to text": "./S2t",
  //  Recording: "./Recording",
  //};
  //
  //const loop_over = function () {
  //  for (const name in names) {
  //  }
  //};

  //const dashboard = (
  //  <div id="nav">
  //    <h1>Initial Page. Navigate to:</h1>
  //    <ul>
  //      {for (i in names)}
  //    </ul>
  //  </div>
  //);

  const dashboard = function () {
    const routes = {
      "Socket Navigation": "./SocketNav",
      "Speech to text": "./S2t",
      recording: "./Recording",
    };
    return (
      <ul>
        {routes.map(function (route, index) {
          return (
            <li key={index}>
              <a href={route[1]}>{route[0]}</a>
            </li>
          );
        })}
      </ul>
    );
  };

  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/Stocks" element={<Stocks />}></Route>
          <Route exact path="/Recording" element={<Recording />}></Route>
          <Route exact path="/Obligations" element={<Obligations />}></Route>
          <Route exact path="/Risk" element={<Risk />}></Route>
          <Route exact path="/S2t" element={<S2t />}></Route>
          <Route exact path="/SocketNav" element={<SocketNavigation />}></Route>
          <Route exact path="/" element={dashboard()}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
